import { View } from 'react-native';
import { MaterialCommunityIcons } from '@expo/vector-icons'; 


const Tabs = ({height}) =>{
    return(

        <View style={{height:height, width:"100%", backgroundColor:"red", position:"absolute", bottom:0}}>
            <View style={{height:"100%", width:"100%", display:'flex', alignItems:'center', justifyContent:'space-between', flexDirection:'row'}}>


                <View style={{width:60, height:60, justifyContent:'center', alignItems:'center', marginBottom:45}}>
                    <MaterialCommunityIcons name="table-furniture" size={24} color="bwhitelack" />
                </View>

            </View>

        </View>

        )
}

export default Tabs;
